      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 50 NOT IN ( - 90 * - CAST ( col2 AS INTEGER ), 79, + 14, - - CAST ( NULL AS INTEGER ) / col1 + + + col0 + - + 23, + col1, - col1, - col1, ( + col0 ) );
  - name: tab2

outputs:
  - name: q9840.out
    data: |
